import React from 'react'
import {connect} from 'react-redux'


class Destinations extends React.Component {

    renderDestinations = () => {
        return this.props.destinations.map(destination => <p key={d.title}>{d.title} x</p>)
    }

    render() {
        return (
            <div>
                Places I've Traveled To
                {console.log(this.props)}
                {this.renderDestinations()}
                {this.props.destinations.title}
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {destinations: state.destinations}
}

export default connect(mapStateToProps)(Destinations)
